import { Link, Route } from "react-router-dom";
import "./Header.scss";
import CoinModal from "../CoinModal/CoinModal";

function Header() {
  return (
    <div className="header">
      <ul className="header__link">
        <Link to="/">
          <button className="header__link--one">Home</button>
        </Link>
        <CoinModal />
        <Route
          to="/virtualWallet"
          component={() => {
            window.location.href =
              "chrome-extension://nkbihfbeogaeaoehlefnkodbefgpgknn/home.html#unlock";
            return null;
          }}
        >
          <button className="header__link--three">
            How Virtual Wallet Works
          </button>
        </Route>
      </ul>
    </div>
  );
}

export default Header;
